import React, { useState } from 'react';
import Button from "@material-ui/core/Button";
import {Typography} from "@material-ui/core";
import makeStyles from "@material-ui/core/styles/makeStyles";

const useStyles = makeStyles({
    button : {
        marginTop : 20,

    }
})

const AskQuestion = () => {

    const [title, setTitle] = useState();
    const [category, setCategory] = useState();
    const [subtitle, setSubtitle] = useState();

    console.log(category);

const classes = useStyles();
    return (
        <div>
            <Typography>Ask a question</Typography>
            <form className="form">
                <input type="text" className="form-input"  placeholder="Enter title" onChange={event => setTitle(event.target.value)} />
                <input type="text" className="form-input"  placeholder="Enter question" onChange={event => setSubtitle(event.target.value)} />
                <input type="text" className="form-input"  placeholder="Enter Category" onChange={event => setCategory(event.target.value)} />
                <Button className={classes.button} variant="contained" color="primary">Submit</Button>
            </form>
        </div>
    )
}

export default AskQuestion;
